import React from 'react'
import { Select } from 'semantic-ui-react'

const options = users.map(u => {
       return (
           key   = u.id,
           value = u.id,
           text  = u.id)
      });


const UserSelector = (users) => (
  <Select placeholder='Select your country' options={options} />
)

export default UserSelector;
